import { Navigate } from 'react-router-dom';

const AuthMiddleware = ({ children }) => {
  const authToken = localStorage.getItem('authToken');
  
  if (!authToken) {
    return <Navigate to="/login" replace />;
  }
  
  return children;
};

export default AuthMiddleware;
